void jh_tackle(char *jh_text, int jh_size, int type) {
    for (int i = 0; i < jh_size; i++) {
        printf("%c", jh_text[i]);
    }
    printf("\n");
}

void jh_update_vec(int vec[jh_type_cnt], char ch) {
    for (int i = 0; i < jh_type_cnt; i++) {
        vec[i] = jh_dtrans[i][vec[i]][(int)ch];
    }
}

int detect_type(const int vec[jh_type_cnt]) {
    bool not_zero = false;
    for (int i = 0; i < jh_type_cnt; i++) {
        int state = vec[i];
        if (state != 0) not_zero = true;
        if (std::find(jh_target_bucket[i].cbegin(), jh_target_bucket[i].cend(), state)
                != jh_target_bucket[i].cend())
            return i;
    }
    if (not_zero)
        return -2;
    else
        return -1;
}

char *getLexeme(char *b, int *type) {
    int curr_vec[jh_type_cnt];
    char *f = b, *old_f = b;
    int old_type = -1, new_type = -1;
    for (int i = 0; i < jh_type_cnt; i++)
        curr_vec[i] = 1;
    while(*f != '\0') {
        jh_update_vec(curr_vec, *f);
        new_type = detect_type(curr_vec);
        if (new_type >= 0) {
            old_type = new_type;
            old_f = f;
        } else if (new_type == -1) {
            *type = old_type;
            return old_f + 1;
        }
        ++f;
    }
    *type = old_type;
    return old_f + 1;
}

int jh_lex() {
    int type = -1;
    if (!fread(jh_buffer, 1, jh_buffer_sz, jh_in))
        return -1;
    char *lexemeBegin = jh_buffer;
    char *forward;

    while (*lexemeBegin != '\0') {
        forward = getLexeme(lexemeBegin, &type);
        if (forward == lexemeBegin) return -2;
        jh_tackle(lexemeBegin, (int)(forward - lexemeBegin), type);
        lexemeBegin = forward;
    }
    return 0;
}


